	private Address ModifiedAddressForFedexShipment(Address receipentAddess)
	{
		String CityName =receipentAddess.getCity();
		String State =receipentAddess.getStateOrProvinceCode();
		System.out.println("Street Name In modified:"+receipentAddess.getStreetLines());
		receipentAddess.setCity(CityName.replaceAll("(?i)road","RD").replaceAll("(?i)NearBy","NR").replaceAll("(?i)Limited", "Ltd").replaceAll("(?i)House No", "Hos").replaceAll("(?i)House", "Hos").replaceAll("(?)Socity", "Soc").replaceAll("(?)Building","Buldg").replaceAll("(?)highway", "HWY"));
		receipentAddess.setStateOrProvinceCode(State.replaceAll("(?i)road","RD").replaceAll("(?i)NearBy","NR").replaceAll("(?i)Limited", "Ltd").replaceAll("(?i)House No", "Hos No").replaceAll("(?i)House", "Hos").replaceAll("(?)Socity", "Soc").replaceAll("(?)Building","Buldg").replaceAll("(?)highway", "HWY"));
		receipentAddess.setCountryCode("IN");
		for(int i=0;i<receipentAddess.getStreetLines().size() ;i++)
		{
			receipentAddess.getStreetLines().set(i,receipentAddess.getStreetLines().get(i).replaceAll(",(?i)road","RD").replaceAll("(?i)NearBy","NR").replaceAll("(?i)road","RD").replaceAll("(?i)Limited", "Ltd").replaceAll("(?i)House No", "Hos No").replaceAll("(?i)House", "Hos").replaceAll("(?)Socity", "Soc").replaceAll("(?)Building","Buldg").replaceAll("(?)highway", "HWY"));
		}
		System.out.println("Street Name after modified:"+receipentAddess.getStreetLines());
		return receipentAddess;
	}
	
	private void updateDORecordsInSFDC(SObject[] records) throws Exception {
		 
		try { 
			// update the records in Salesforce.com
			SaveResult[] saveResults = connection.update(records);
			// check the returned results for any errors
			for (int i=0; i< saveResults.length; i++) {
				if (saveResults[i].isSuccess()) {
					System.out.println(i+". Successfully updated record - Id: " + saveResults[i].getId());
				}else {
					String errorMessage = "ERROR: ";
					Error[] errors = saveResults[i].getErrors();
					for (int j=0; j< errors.length; j++) {
						errorMessage += errors[j].getMessage() + " ";
						System.out.println("ERROR updating record: " + errors[j].getMessage());
					}
					throw new Exception(errorMessage);
				}   
			}
		} catch (ApiFault e) { 
			init();
		} catch (Exception e) {
			logger.info(e.getMessage());
			e.printStackTrace();
			throw e;
		}

	}

	private String processReply(PartnerConnection connection2, ProcessShipmentReply reply, ArrayList<SObject> dosToUpdate) throws Exception {
		FileOutputStream imageOutFile = null;
		try {
			String dispatchOrderId = reply.getTransactionDetail().getCustomerTransactionId();
			NotificationSeverityType highestError = reply.getHighestSeverity();
			if(highestError == NotificationSeverityType.ERROR || highestError == NotificationSeverityType.FAILURE){
				//Write code for Error handling and email
				String errorMessage = "Error received from FedEx: ";
				List<Notification> errorNotifications = reply.getNotifications();
				for (Notification notification : errorNotifications) {
					errorMessage = errorMessage + notification.getMessage() + "\n";
				}
				
				SObject sObject = new SObject();
				sObject.setType("Dispatch_Order__c");
				sObject.setId(dispatchOrderId);
				sObject.setField("FedEx_Ship_Order_Creation_Error__c", errorMessage);
				
				dosToUpdate.add(sObject);
				throw new Exception(errorMessage);
			}
			
			
			String trackingNumber = reply.getCompletedShipmentDetail().getCompletedPackageDetails().get(0).getTrackingIds().get(0).getTrackingNumber();
			byte[] encodedImage = reply.getCompletedShipmentDetail().getCompletedPackageDetails().get(0).getLabel().getParts().get(0).getImage();

			System.out.println("encodedImage = "+encodedImage);
			
			String randomString = RandomStringUtils.randomAlphanumeric(12);
			// Write a image byte array into file system
			String filePath = ADMISSION_DOCUMENTS_PATH + "AirwayBills/" + dispatchOrderId + "_" + randomString + ".pdf";
			String filePreviewPath = SFDC_DOCUMENTS_BASE_PATH + "AirwayBills/" + dispatchOrderId + "_" + randomString + ".pdf";
			imageOutFile = new FileOutputStream(filePath);
			imageOutFile.write(encodedImage);
			imageOutFile.close();
			
			System.out.println("Airway Bill File created for DO: "+dispatchOrderId);
			
			SObject sObject = new SObject();
			sObject.setType("Dispatch_Order__c");
			sObject.setId(dispatchOrderId);
			sObject.setField("Tracking_Number__c", trackingNumber);
			sObject.setField("Fed_Ex_Shipment_Created__c", true);
			sObject.setField("Airway_Bill_Image__c", filePreviewPath);
			
			dosToUpdate.add(sObject);
			return trackingNumber;

		} catch (Exception e) {
			e.printStackTrace();
			throw e;
		}
	}

	private RequestedPackageLineItem getRequestedPackageLineItemNode(String dispatchOrderId) {
		RequestedPackageLineItem requestedPackageLineItem = new RequestedPackageLineItem();

		requestedPackageLineItem.setSequenceNumber(new BigInteger("1"));
		requestedPackageLineItem.setGroupPackageCount(new BigInteger("1"));

		Weight weight = new Weight();
		weight.setUnits(WeightUnits.KG);
		weight.setValue(new BigDecimal(5));
		requestedPackageLineItem.setWeight(weight);

		Dimensions dimensions = new Dimensions();
		dimensions.setHeight(new BigInteger("10"));
		dimensions.setWidth(new BigInteger("21"));
		dimensions.setLength(new BigInteger("28"));
		dimensions.setUnits(LinearUnits.CM);
		requestedPackageLineItem.setDimensions(dimensions);

		CustomerReference customerReference = new CustomerReference();
		customerReference.setCustomerReferenceType(CustomerReferenceType.CUSTOMER_REFERENCE);
		customerReference.setValue(dispatchOrderId);
		requestedPackageLineItem.getCustomerReferences().add(customerReference);
		
	/*	customerReference = new CustomerReference();
		customerReference.setCustomerReferenceType(CustomerReferenceType.PROGRAM_SEM);
		customerReference.setValue(programSem);
		requestedPackageLineItem.getCustomerReferences().add(customerReference);*/
		
		
		customerReference = new CustomerReference();
		customerReference.setCustomerReferenceType(CustomerReferenceType.P_O_NUMBER);
		customerReference.setValue("B2C");
		requestedPackageLineItem.getCustomerReferences().add(customerReference);
		
		customerReference = new CustomerReference();
		customerReference.setCustomerReferenceType(CustomerReferenceType.DEPARTMENT_NUMBER);
		customerReference.setValue("BILL D/T: SENDER");
		requestedPackageLineItem.getCustomerReferences().add(customerReference);

		return requestedPackageLineItem;
	}

